    const FoodList = {};
    return (
        <OrdersSection>
            <FormSection>
                <FoodForm></FoodForm>
            </FormSection>
            <PreviewSection>
                <Food id={FoodList.id} title ={FoodList.title} img={FoodList.img} ingrendients={FoodList.ingrendients} price={FoodList.price}></Food>
            </PreviewSection>
        </OrdersSection>
       
    )
}

export default FoodUpload
